	private String[][] applyRules(String[][] input) {
		String[][] clone = clone(input);
		for (int i = 0; i < input.length; i++) {
			for (int j = 0; j < input[i].length; j++) {
				if ("L".equals(input[i][j])) {
					if (countSeatsOccupied(getAdjacent(input, i, j)) == 0) {
						clone[i][j] = "#";
					}					
				}
				if ("#".equals(input[i][j])) {
					if (countSeatsOccupied(getAdjacent(input, i, j)) > 3) {
						clone[i][j] = "L";
					}					
				}
			}
		}
		return clone;
	}
	private String[][] applyRules2(String[][] input) {
		String[][] clone = clone(input);
		for (int i = 0; i < input.length; i++) {
			for (int j = 0; j < input[i].length; j++) {
				if ("L".equals(input[i][j])) {
					if (countSeatsOccupied(getAdjacent2(input, i, j)) == 0) {
						clone[i][j] = "#";
					}					
				}
				if ("#".equals(input[i][j])) {
					if (countSeatsOccupied(getAdjacent2(input, i, j)) > 4) {
						clone[i][j] = "L";
					}					
				}
			}
		}
		return clone;
	}
	
	private String[][] clone(String[][] input) {
		String[][] _return = new String[input.length][input[0].length];
		for (int i = 0; i < input.length; i++) {
			for (int j = 0; j < input[i].length; j++) {
				_return[i][j] = input[i][j] + "";
			}
		}
		return _return;
	}

	private List<String> getAdjacent(String[][] input, int i, int j) {
		List<String> _return = new ArrayList<>();
		if (i > 0) {
			_return.add(input[i-1][j]);
			if (j < input[i].length-1) {
				_return.add(input[i-1][j+1]);
			}
			if (j > 0) {
				_return.add(input[i-1][j-1]);				
			}
		}
		if (i < input.length-1) {
			_return.add(input[i+1][j]);
			if (j < input[i].length-1) {
				_return.add(input[i+1][j+1]);			
			}
			if (j > 0) {
				_return.add(input[i+1][j-1]);			
			}
		}
		if (j < input[i].length-1) {
			_return.add(input[i][j+1]);
		}
		if (j > 0) {	
			_return.add(input[i][j-1]);				
		}
		return _return;
	}
	
	private List<String> getAdjacent2(String[][] input, int i, int j) {
		List<String> _return = new ArrayList<>();
		if (i > 0) {
			addCloseSeat(input, i, j, -1, 0, -1, -1, _return);
			if (j < input[i].length-1) {
				addCloseSeat(input, i, j, -1, 1, -1, input[i].length, _return);
			}
			if (j > 0) {
				addCloseSeat(input, i, j, -1, -1, -1, -1, _return);
			}
		}
		if (i < input.length-1) {
			addCloseSeat(input, i, j, 1, 0, input.length, -1, _return);
			if (j < input[i].length-1) {
				addCloseSeat(input, i, j, 1, 1, input.length, input[i].length, _return);
			}
			if (j > 0) {
				addCloseSeat(input, i, j, 1, -1, input.length, -1, _return);
			}
		}
		if (j < input[i].length-1) {
			addCloseSeat(input, i, j, 0, 1, -1, input[i].length, _return);
		}
		if (j > 0) {	
			addCloseSeat(input, i, j, 0, -1, -1, -1, _return);			
		}
		return _return;
	}
	
	private void addCloseSeat(String[][] input, int i, int j, int incrI, int incrJ, int guardI, int guardJ, List<String> list) {
		int x = i + incrI;
		int y = j + incrJ;
		while (x != guardI && y != guardJ && ".".equals(input[x][y])) {
			x += incrI;
			y += incrJ;
		}
		if (x != guardI && y != guardJ) {
			list.add(input[x][y]);				
		}
	}
	
	private int countSeatsOccupied(String[][] input) {
		int count = 0;
		for (String[] strings : input) {
			for (String string : strings) {
				if ("#".equals(string)) {
					count++;
				}
			}
		}
		return count;
	}
	
	private int countSeatsOccupied(List<String> list) {
		return countSeats("#", list);
	}

	private int countSeats(String expect, List<String> list) {
		if (expect == null) {
			throw new IllegalArgumentException();
		}
		int count = 0;
		for (String string : list) {
			if (expect.equals(string)) {
				count++;
			}
		}		
		return count;
	}
	
